// src/components/Mission.js
import React, { useContext } from "react";
import LanguageContext from "../LanguageContext";
import "../App.css";

function Mission() {
  const { isEnglish } = useContext(LanguageContext);

  return (
    <section id="mission" className="mission">
      <h2>{isEnglish ? "Our Mission" : "ተልዕኮዓችን"}</h2>
      <p>
        {isEnglish
          ? "To meet critical healthcare needs across the U.S. by serving as a trusted liaison connecting international RNs with healthcare providers. We prioritize ethics, reliability, and efficiency to provide top-notch professional candidates."
          : "በአሜሪካ አገር ውስጥ ከሚገኙ ሕክምና ተቋማት ጋር የተገባ ግንኙነት በመስጠት ከሰፊ ጤና ፍላጎቶች ጋር ለመተግበር፣ ስንስሳለን ተፅዕኖ ያለው አዳዲስ ተሟላ ነርስ እንዲሆኑ እንደገና የማስገንዘብ ግንኙነት ማስተባበሪያ እንደሆን ተልዕኮዓችን ነው።"}
      </p>
    </section>
  );
}

export default Mission;
